require(['jquery'], function ($) {
  $(document).ready(function() {
    $("#submitForm").click(function() {
      $("#progresLogs").show(); // Display more details div
      $("#loading").show(); // Display loading gif
      $("#infoToBeDescarded").remove();
      var postUrl = window.location.pathname + '?xpage=plain&apply=1';
      var docsTBC = $("#docsToBeChanged").val();
      var scriptTBA = $("#scriptToBeApplied").val();
      // Proccessing form information
      $.post(postUrl, {
      docsToBeChanged: docsTBC,
      script: scriptTBA
      }, function(data) {
      $("#loading").hide(); // To Hide loading gif
      alert('Your script has been applied!')
      });
    });
    $("#moreDetails").click(function() {
      $("#moreDetailsWindow").toggle(); // Display more details div
    });
    $("#showLog").click(function() {
      var postUrl = '/xwiki/bin/edit/Admin/LogTail?xpage=plain';
      var logFile = $("#logFile").val();
      var showlogVal = $("#showlogVal").val();
      // Proccessing form information
      $.post(postUrl, {
      logfile: logFile,
      showlog: showlogVal
      }, function(data) {
      $("#logsWindow .box").remove();
      $("#logsWindow").append(data); // To Hide loading gif
      var codebox = $("#logsWindow .box");
      codebox.scrollTop(codebox.prop("scrollHeight"));
      codebox.scrollLeft(codebox.prop("scrollWidth"));
      });
    });
  });
});

#logsWindow .code{
  height:300px;
}

#loading{
  text-align: center;
  display: none;
}

#progresLogs{
  display: none;
}
#moreDetailsWindow{
  display: none;
]
